import React, { Component } from 'react'
import { Route } from 'react-router'
import './App.css';
import searchUser from './searchUser';

class App extends Component {
  render() {
    return (
      <router>
        <div className="App container">
          <Route path="/searchUser" component={searchUser} />
        </div>
      </router>
    );
  }
}

export default App;
